const config = {
  screens: {
    Home: {
      path: "./pages/Home",
    },
    PrepareToLogin: {
      path: "./pages/PrepareToLogin",
    },
    LinkExpo: {
      path: "./pages/LinkExpo",
    },
    CallBack: {
      path: "./pages/CallBack",
    },
    Login: {
      path: "./pages/Login",
    },
  },
};

const linking = {
  prefixes: ["appcliente://app"],
  config,
};

export default linking;
